import React from 'react';
import ReactDOM  from 'react-dom';
import './App.css'; 

const Title = () => (
  <a href='/'>
    Food Villa
  </a>
);
const HeaderComponent = () => {
  return(
    <div className='header'>
      <Title/>
      <div className='navitems'>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const Body =() =>{
  return(
    <h1>Body</h1>
  )
}
const Footer =() =>{
  return(
    <h1>Footer</h1>
  )
}
const Applayout = ()=>{
  return(
    <>
    <HeaderComponent/>
     <Body/>
     <Footer/>
      </>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Applayout/>);
